"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([[9501],{5272:t=>{t.exports=JSON.parse('{"name":"Ansible","url":"https://codeberg.org/woodpecker-plugins/ansible","icon":"https://codeberg.org/woodpecker-plugins/ansible/media/branch/main/ansible.png","description":"Plugin to execute Ansible playbooks","docs":"<h1>Overview</h1>\\n<p>Woodpecker CI plugin to execute Ansible playbooks.\\nThis plugin is a fork of <a href=\\"https://github.com/drone-plugins/drone-ansible\\">drone-plugins/drone-ansible</a> with substantial modifications of the source code.</p>\\n<h2>Features</h2>\\n<ul>\\n<li>Install required dependencies before the start of a playbook</li>\\n<li>Execute Ansible playbooks</li>\\n</ul>\\n<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>become-method</code></td>\\n<td><em>none</em></td>\\n<td>privilege escalation method to use</td>\\n</tr>\\n<tr>\\n<td><code>become-user</code></td>\\n<td><em>none</em></td>\\n<td>run operations as this user</td>\\n</tr>\\n<tr>\\n<td><code>become</code></td>\\n<td><code>false</code></td>\\n<td>run operations with become</td>\\n</tr>\\n<tr>\\n<td><code>check</code></td>\\n<td><code>false</code></td>\\n<td>run in \\"check mode\\"/dry-run, do not apply changes</td>\\n</tr>\\n<tr>\\n<td><code>connection</code></td>\\n<td><em>none</em></td>\\n<td>connection type to use</td>\\n</tr>\\n<tr>\\n<td><code>diff</code></td>\\n<td><code>false</code></td>\\n<td>show the differences (may print secrets!)</td>\\n</tr>\\n<tr>\\n<td><code>extra-vars</code></td>\\n<td><em>none</em></td>\\n<td>set additional variables as key=value</td>\\n</tr>\\n<tr>\\n<td><code>flush-cache</code></td>\\n<td><code>false</code></td>\\n<td>clear the fact cache for every host in inventory</td>\\n</tr>\\n<tr>\\n<td><code>force-handlers</code></td>\\n<td><em>none</em></td>\\n<td>run handlers even if a task fails</td>\\n</tr>\\n<tr>\\n<td><code>forks</code></td>\\n<td><code>5</code></td>\\n<td>number of parallel processes to use</td>\\n</tr>\\n<tr>\\n<td><code>galaxy-force</code></td>\\n<td><code>true</code></td>\\n<td>force overwriting an existing role or collection</td>\\n</tr>\\n<tr>\\n<td><code>galaxy</code></td>\\n<td><em>none</em></td>\\n<td>path to galaxy requirements file</td>\\n</tr>\\n<tr>\\n<td><code>inventory</code></td>\\n<td><em>none</em></td>\\n<td>specify inventory host path</td>\\n</tr>\\n<tr>\\n<td><code>limit</code></td>\\n<td><em>none</em></td>\\n<td>limit selected hosts to an additional pattern</td>\\n</tr>\\n<tr>\\n<td><code>list-hosts</code></td>\\n<td><code>false</code></td>\\n<td>outputs a list of matching hosts</td>\\n</tr>\\n<tr>\\n<td><code>list-tags</code></td>\\n<td><code>false</code></td>\\n<td>list all available tags</td>\\n</tr>\\n<tr>\\n<td><code>list-tasks</code></td>\\n<td><code>false</code></td>\\n<td>list all tasks that would be executed</td>\\n</tr>\\n<tr>\\n<td><code>module-path</code></td>\\n<td><em>none</em></td>\\n<td>prepend paths to module library</td>\\n</tr>\\n<tr>\\n<td><code>playbook</code></td>\\n<td><em>none</em></td>\\n<td>list of playbooks to apply</td>\\n</tr>\\n<tr>\\n<td><code>private-key</code></td>\\n<td><em>none</em></td>\\n<td>SSH private key to connect to host</td>\\n</tr>\\n<tr>\\n<td><code>requirements</code></td>\\n<td><em>none</em></td>\\n<td>path to python requirements file</td>\\n</tr>\\n<tr>\\n<td><code>scp-extra-args</code></td>\\n<td><em>none</em></td>\\n<td>specify extra arguments to pass to scp only</td>\\n</tr>\\n<tr>\\n<td><code>sftp-extra-args</code></td>\\n<td><em>none</em></td>\\n<td>specify extra arguments to pass to sftp only</td>\\n</tr>\\n<tr>\\n<td><code>skip-tags</code></td>\\n<td><em>none</em></td>\\n<td>skip tasks and playbooks with a matching tag</td>\\n</tr>\\n<tr>\\n<td><code>ssh-common-args</code></td>\\n<td><em>none</em></td>\\n<td>specify common arguments to pass to sftp/scp/ssh</td>\\n</tr>\\n<tr>\\n<td><code>ssh-extra-args</code></td>\\n<td><em>none</em></td>\\n<td>specify extra arguments to pass to ssh only</td>\\n</tr>\\n<tr>\\n<td><code>start-at-task</code></td>\\n<td><em>none</em></td>\\n<td>start the playbook at the task matching this <strong>name</strong></td>\\n</tr>\\n<tr>\\n<td><code>syntax-check</code></td>\\n<td><code>false</code></td>\\n<td>perform a syntax check on the playbook</td>\\n</tr>\\n<tr>\\n<td><code>tags</code></td>\\n<td><em>none</em></td>\\n<td>only run plays and tasks tagged with these values</td>\\n</tr>\\n<tr>\\n<td><code>timeout</code></td>\\n<td><em>none</em></td>\\n<td>override the connection timeout in seconds</td>\\n</tr>\\n<tr>\\n<td><code>user</code></td>\\n<td><em>none</em></td>\\n<td>connect as this user</td>\\n</tr>\\n<tr>\\n<td><code>vault-id</code></td>\\n<td><em>none</em></td>\\n<td>the vault identity to used</td>\\n</tr>\\n<tr>\\n<td><code>vault-password</code></td>\\n<td><em>none</em></td>\\n<td>vault password</td>\\n</tr>\\n<tr>\\n<td><code>verbose</code></td>\\n<td><code>0</code></td>\\n<td>level of verbosity, 0 up to 4</td>\\n</tr>\\n</tbody></table>\\n","tags":["ansible","playbook","automation"],"containerImage":"woodpeckerci/plugin-ansible","containerImageUrl":"https://hub.docker.com/r/woodpeckerci/plugin-ansible","verified":true}')}}]);